  return (
    <>
      <ButtonTypography />
      <FilePicker label="Upload a file" size="small">
        Choose File
      </FilePicker>
      <br />
      <FilePicker label="Upload a file" required>
        Choose File
      </FilePicker>
      <br />
      <FilePicker label="Upload a file" size="large">
        Choose File
      </FilePicker>
    </>
  );
}
